let cryptoEl = document.getElementById("crypto-top")
let priceEl =  document.getElementById("crypto")

fetch("https://apis.scrimba.com/unsplash/photos/random?orientation=landscape&query=varanasi")
    .then(res => res.json())
    .then(data => {
        console.log(data.urls.regular)
        document.body.style.backgroundImage = `url(${data.urls.regular})`
		document.getElementById("author").textContent = `By: ${data.user.name}`
    })
    .catch(err => {
        /**
         * Challenge: get a URL for a default background image and set it here
         * 
         * 1. Change the query in the URL above back to something real
         * 2. Log the image url to the console (replacing console.log(data) above)
         * 3. Use that URL as the "default" background image to be used if 
         *    the promise is ever rejected.
         */
        document.body.style.backgroundImage = `url(https://images.unsplash.com/photo-1584005609799-94866308b1c0?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxNDI0NzB8MHwxfHJhbmRvbXx8fHx8fHx8fDE2Mzc0NTYzNzk&ixlib=rb-1.2.1&q=80&w=1080 )`
        // Report the error to some kind of service
        document.getElementById("author").textContent = `By: Colour Comet`
    })

    fetch("https://api.coingecko.com/api/v3/coins/bitcoin")
    .then(res => {
        if (!res.ok) {
            throw Error("Something went wrong")
        }
        console.log(res.status)
        return res.json()
    })
    .then(data => {
      cryptoEl.innerHTML = `
      <img src=${data.image.small} />
      <span>${data.name}</span>
  `
 priceEl.innerHTML += `
            <p>üéØ: $${data.market_data.current_price.usd}</p>
            <p>üëÜ: $${data.market_data.high_24h.usd}</p>
            <p>üëá: $${data.market_data.low_24h.usd}</p>
        `
    })
    .catch(err => console.error(err))

    function getCurrentTime() {
      const date = new Date()
      document.getElementById("time").textContent = date.toLocaleTimeString("en-us", {timeStyle: "medium"})
  }
  
  setInterval(getCurrentTime, 1000)

  navigator.geolocation.getCurrentPosition(position => {
    fetch(`https://apis.scrimba.com/openweathermap/data/2.5/weather?lat=${position.coords.latitude}&lon=${position.coords.longitude}&units=imperial`)
        .then(res => {
            if (!res.ok) {
                throw Error("Weather data not available")
            }
            return res.json()
        })
        .then(data => {
            // console.log(data)
            const iconUrl = `http://openweathermap.org/img/wn/${data.weather[0].icon}@2x.png`
            document.getElementById("weather").innerHTML = `
                <img src=${iconUrl} />
            `
        })
        .catch(err => console.error(err))
});


